import { UpArrowContainer } from "./styles";
import upArrowIcon from "../../assets/upArrowIcon.svg";
import { motion } from "framer-motion";

const upScrollVariant = {
  hover: {
    scale: 1.2,
  },
};

const ScrollUp = () => {
  return (
    <UpArrowContainer
      as={motion.div}
      variants={upScrollVariant}
      whileHover="hover"
    >
      <motion.img
        src={upArrowIcon}
        alt="arrow"
        variants={upScrollVariant}
        whileHover="hover"
      />
    </UpArrowContainer>
  );
};

export default ScrollUp;
